        address dest,
        uint256 srcQty,
        uint256 platformFeeBps,
        bytes calldata hint
    )
        external
        view
        returns (uint256 expectedRate);
}

interface IKyberHintHandler {

    enum TradeType {BestOfAll, MaskIn, MaskOut, Split}

    enum ProcessWithRate {NotRequired, Required}

    function getTradingReserves(
