    )
        external
        view
        returns (bytes memory hint);

    function buildEthToTokenHint(
        address tokenDest,
        TradeType ethToTokenType,
        bytes32[] calldata ethToTokenReserveIds,
        uint256[] calldata ethToTokenSplits
    )
        external
        view
        returns (bytes memory hint);

    function buildTokenToTokenHint(
